  const [data, setData] = useState([]);
  const url = "https://jsonplaceholder.typicode.com/users";
  return (
    <>
      <Header />
      <h2>Home Page</h2>
      <>
        <p>Hi there!</p>
        <br />
        <Counter />
      </>
    </>
  );
}
